          "data:image/jpeg;base64,",
      "message":
          "<p>Who is FIRST in your life? Is it your wife? Is it your boyfriend? Is it your phone? Is it the things you have?</p><p><br></p><p>Matthew 6:33 says seek ye first the Kingdom of God and His Righteousness and all other things shall be added unto you.</p><p><br></p><p>We will have no other gods before Him ( Exodus 20:3). And Deuteronomy 5:8-9 says, You must not make for yourself an idol of any kind, or an image of anything in the heavens or on the earth or in the sea.&nbsp;You must not bow down to them or worship them, for I, the Lord your God, am a jealous God who will not tolerate your affection for any other gods.</p><p><br></p><p>Yet how many of the things that occupy our time, money, thoughts and attention have taken the place where God is supposed to be?</p><p><br></p><p>Make it your goal to have a deep, intimate relationship with God. Let Him into every area of your life. If you constantly look to other people for answers and validation, pray about this and ask the Lord to help you stop doing that and instead look to Him. (1 Thessalonians 2:4.) As we live to please God, He promises to bless our lives and make us prosper.</p><p><br></p><p>When you decide to serve God with your whole heart and make Him first in your life, your soul will prosper and your joy and peace will increase. Remember to lean on Him more than anything else, and tell Him, “God, I want to do this, but I can’t do it without You.” He doesn’t expect you to live for Him in your own strength or ability, and He understands when you make mistakes.</p><p><br></p><p>So if you mess up, don’t be discouraged and let it hold you back; confess it and keep going. God will give you grace to do what you need to do. One day at a time, you and God together can do anything!</p><p><br></p><p>Always put Him First and He will guide you and carry you through.</p><p>🤲 Prayer</p><p>Dear Heavenly Father,</p><p><br></p><p>Today, I choose to put You first. I acknowledge that without You, I can do nothing. I invite You to have Your way in my life as I seek You first in all that I do in Jesus’ name. Amen.</p><p><br></p><p><br></p><p>Have a great day ahead</p><p>From Shine 3.16</p><p><br></p><p>Kindly follow us on:</p><p>http://instagram.com/shine3.16</p><p>https://vm.tiktok.com/ZMNHEjdBL/</p><p>http://facebook.com/shine3.16https://vm.tiktok.com/ZMNHEjdBL/</p>",
      "scripture": ["Matthew 6:33"],
      "subtitle": "Who is FIRST in your life?",
      "timestamp": {"__time__": "2022-10-22T08:58:44.314Z"},
      "title": "Put God First"
    },
    {
      "__path__": "messages/NKFsy2vrSGvWKNHnFvXP",
      "author": "Shine 3:16",
      "image":
          "data:image/png;base64,",
      "message":
          "<p>He has made everything beautiful in its time. Also He has put eternity in their hearts, except that no one can find out the work that God does from beginning to end. </p><p><br></p><p>Ecclesiastes 3:11 </p><h2><br></h2><h2><em>If you study and look through the scriptures, you will always see that the timing of God is never late. God is never late! He is always on time! And the scripture tells us in Romans 8:28: “And we know that all things work together for good to them that love God, to them who are the called according to His purpose”. </em></h2><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p>We know, we are not ignorant! We are supposed to know. We should be armed with the understanding that the Lord knows how to use both the good, the bad and the ugly for our good. He knows how to turn things around together for those that love Him and for them that are called according to His purpose. </p><p><br></p><p>God has called you according to His purpose; therefore, everything that is around you that looks ugly is turning around. Don’t ever settle for the ugly situation because God is at work. At times we don’t see it with our eyes. But remember we walk by faith and not by sight! We don’t see all that is happening behind the scene but I guarantee you that no matter what the situation is, it is turning around. It must turn around because ‘beauty for ashes, oil of joy for mourning and the garment of praise for the spirit of heaviness’ are your entitlement in Christ. In a very short time from now, your mouth will testify. You have prayed and you have looked up to Him, your face will not be ashamed. It may look as if your prayers are not answered, but let me assure you that God is working it out for you. The devil is a liar! Don’t look at the circumstances and the challenges! Put your eyes on God. He who has begun the good work will complete it. Your testimony will not be delayed.</p><p><br></p><p>Praise Him for the Manifestation! 🤲 </p><p>Prayer Dear Heavenly Father I thank You Lord for Your Word. I will trust Your way though it isn't easy to wait. But I know you will renew my strength and make it all work for my good. I know Father, that You are never late. Give me the grace to trust and wait on God by Praising You for manifestation in Jesus name, Amen Have a great day ahead From Shine 3.16 </p><p><br></p><p>Kindly follow us on </p><p><br></p><p><a href=\"http://instagram.com/shine3.16 \" rel=\"noopener noreferrer\" target=\"_blank\">http://instagram.com/shine3.16 </a></p><p><a href=\"https://vm.tiktok.com/ZMNHEjdBL/ \" rel=\"noopener noreferrer\" target=\"_blank\">https://vm.tiktok.com/ZMNHEjdBL/ </a></p><p><a href=\"http://facebook.com/shine3.16\" rel=\"noopener noreferrer\" target=\"_blank\">http://facebook.com/shine3.16</a></p>",
      "scripture": ["Ecclesiastes 3:11 "],
