          "data:image/jpeg;base64,",
      "message":
          "Light of the World is a phrase Jesus used to describe himself and his disciples in the New Testament. The phrase is recorded in the Gospels of Matthew and John. It is closely related to the parables of Salt and Light and Lamp under a bushel, which also appear in Jesus' Sermon on the Mount. ",
      "scripture": [],
      "subtitle": "We are the light of the world.",
