      "title": "Shine the Light"
    },
    {
      "__path__": "messages/QElJwQhjLvWoyqH8fg6v",
      "author": "Shine 3: 16",
      "image":
          "data:image/jpeg;base64,",
      "message":
          "<p>God doesn’t just call us to draw near for His own benefit. Drawing near to God and walking in the spirit are a lifestyle, a lifestyle of victory.&nbsp;The more you abide in God’s Word and in His presence, the more you will hear His voice and the more victorious and successful you will be in every area of life.</p><p>Additionally, The Word says God is a rewarder of those who diligently seek Him (Hebrews 11:6). A reward is a prize, an honor, a gift. That’s what you can expect when you spend time drawing near to Him.&nbsp;</p><p>Importance of drawing near to God</p><p><br></p><h2><strong><em>1. God Will Draw Near to You</em></strong></h2><p><br></p><p>“Draw near to God and He will draw near to you.” –James 4:8 (NKJV)</p><p>To draw near to God, as is talked about in Hebrews 11:6, is to diligently seek Him.</p><p>What does it meant to diligently seek Him?This means&nbsp;“persevering attention, constant effort, persistent.” In other words, when you draw near to God, you don’t just do so once in a while or when the mood strikes you. To diligently seek Him is to drop the things that are stealing your time from reading the Word and praying. Spending time with God becomes a priority in your life. It means when you have to go to work, you get up early enough to pray instead of skipping time with Him. It is a persistent and constant effort on your part to draw near.</p><p>Hebrews 11:6 says, “He rewards the faith of those who give all their passion and strength into seeking him.”</p><p>It says He rewards those who give all their passion and strength. What does that look like to you?</p><p>Some would call it pressing in. Not just pressing in to God or reading more Word or praying more. Pressing in to His presence.</p><p>The reward is that He, in turn, will draw near to you. There will be a closeness between you and God—a fellowship—a friendship. Nothing is more precious than friendship with Almighty God.</p><p>When He draws near to you, the doors of communication are wide open. You can hear His instruction, correction and encouragement. And, you will enjoy the other rewards that come directly through this relationship.</p><p>🤲 PrayerDear Heavenly Father,</p><p>I come before You today, completely yielded and surrendered to you. I sincerely desire to draw closer to you and live my life to the glory of your name. Forgive me of my inconsistency in seeking you and give me the grace to be consistent and totally yielded to you as you draw near to me in Jesus name, Amen.</p><p>Have a great day ahead</p><p><br></p><p>From Shine 3.16</p><p><br></p><p>Kindly follow us on:</p><p><br></p><p><a href=\"http://instagram.com/shine3.16\" rel=\"noopener noreferrer\" target=\"_blank\">http://instagram.com/shine3.16</a></p><p><a href=\"https://vm.tiktok.com/ZMNHEjdBL/\" rel=\"noopener noreferrer\" target=\"_blank\">https://vm.tiktok.com/ZMNHEjdBL/</a></p><p><a href=\"http://facebook.com/shine3.16https://vm.tiktok.com/ZMNHEjdBL/\" rel=\"noopener noreferrer\" target=\"_blank\">http://facebook.com/shine3.16https://vm.tiktok.com/ZMNHEjdBL/</a></p>",
      "scripture": ["James 4:8 (NKJV)", "psalms1:8"],
