          "data:image/jpeg;base64,",
      "message":
          "<p>On a certain day, you were formed and made. It was all for a purpose. </p><p><br></p><p><strong style=\"background-color: rgb(230, 0, 0); color: rgb(255, 255, 255);\"><em>Romans 8:31</em></strong></p><p><em>What then shall we say to these things? If God is for us, who is against us? Many things appear to be working against us, </em></p><h2><br></h2><h2><em>But He causes even these to work for our good. What more could God do than send His own Son into this world to be our Saviour? Surely this is sufficient proof that He loves us (John 3:16);</em></h2><p><br></p><p><em>and notice in verse 32 we are told not only that God did not withhold His own Son but that He delivered Him up for us all. Here undoubtedly is reference to the purpose for which </em>Christ came into the world, which was to become a sacrifice for our sins and to offer Himself upon the cross of Calvary Also, We know that God is FOR us because He has settled the question of our sin. The One who knew no sin became sin for mankind to be save too. We know that God is FOR us because He has promised that all things will work together for our good (Romans 8:28). Many things appear to be working against us, but He causes even these to work for our good. This verse makes no claim that everything will work out in this life if we have faith. Rather, in a courtroom, no evidence can be held against us. God is in the process of sanctifying us. Those who trust in Christ can no longer be condemned. In Jesus name, Amen 🤲 Prayer Dear Heavenly Father, I thank You for all You have done in and through us. I believe that you are for us Always. I yield myself completely to You and I know you are working all things out for me in Jesus name Amen Have a great day ahead From Shine 3.16 Kindly follow us on:</p><p><a href=\"http://instagram.com/shine3.16 \" rel=\"noopener noreferrer\" target=\"_blank\">http://instagram.com/shine3.16 </a><a href=\"https://vm.tiktok.com/ZMNHEjdBL/ \" rel=\"noopener noreferrer\" target=\"_blank\">https://vm.tiktok.com/ZMNHEjdBL/ </a><a href=\"http://facebook.com/shine3.16 \" rel=\"noopener noreferrer\" target=\"_blank\">http://facebook.com/shine3.16 </a></p>",
      "scripture": ["Romans 8 : 31"],
      "subtitle": "Arise and Shine",
      "timestamp": {"__time__": "2022-10-16T20:59:38.111Z"},
      "title": "God is for me"
    },
