      "message":
          "Most Christians do not have planting and harvesting mindset .  They read a book or hear a sermon and give an offering to God, then wake up Monday morning complaining: “Hey Lord, I gave, but it didn’t work.”\n\nThe Bible says whatever you have planted will come up.\n\nYou see, giving to God is like a farmer planting seed. The day after he plants, the farmer does not run out to his field and say, “It didn’t work! It didn’t work! My wheat seed didn’t come up.”\n\nToday, many people function in a fast- fast gmentality. Everything is instant. We have instant downloads, instant noodles, instant mashed potatoes, and instant banking.\n\nBut, the principles of biblical giving are based on farming, not fast fast principles. God is not the great spiritual slot machine  in the sky.\n\n You do not put in a hundred dollars and instantly get back a thousand. No, you plant a hundred dollars into God’s work. You let that seed grow, mature, and develop so that “in due season” God will return to you many times what you have planted.\n\nIt takes faith and patience to bring these God-given principles to their fullest potential. You must regularly plant your seed. At first your sowing may look futile.\n\nHowever, there will come a day when the harvest will begin to come up in such abundance that you will have more than enough!\n\nGalatians 6:9 says:“in due season we shall reap, if we faint not.”\n\nWhen you begin to receive the harvest, go ahead and eat some of the seed. Go ahead and buy a nice car or a new suit, or whatever you desire. Just be sure you save enough seed to plant again.\n\nKeep putting more money seeds into the gospel. Then God will return to you even more of His abundance in constantly increasing harvests so that you can finance His end-time work.\n\n🤲 Prayer\nDear Heavenly Father,\n\nI thank You LORD for Your Word. Lord please grant me understanding of the power in giving and give me the grace to be a cheerful giver with a genuine heart. Thank you for your blessings in my life and may all my giving and sacrifices be acceptable unto You in Jesus name, Amen\n\nHave a great day ahead\nFrom Shine 3.16.\n\nKindly follow us on:\nhttp://instagram.com/shine3.16\nhttps://vm.tiktok.com/ZMNHEjdBL/\nhttp://facebook.com/shine3.16",
      "scripture": ["James 1: 2"],
      "subtitle": "Giving Brings Harvest",
      "timestamp": {"__time__": "2022-10-17T10:42:58.374Z"},
      "title": "Benefit of Giving"
    },
    {
      "__path__": "messages/iQBpm47iEAt4i1LzY98W",
      "author": "Shine 316",
      "image":
          "data:image/jpeg;base64,",
      "message":
          "You may have heard those end-of-time predictions by Christians who have foretold a specific date and time in which Jesus is sure to return. This never fails to amuse me, especially since the Bible states we do not know the specific day or hour of His return (see Matthew 24:36). But is predicting Jesus’ second coming the same as claiming that we are living in the last days?\n\nNot exactly. “The Last Days” doesn’t necessarily refer to a set amount of time; after all, God uses a different measurement for time than us humans. 2 Peter 3:8 says, “With the Lord a day is like a thousand years, and a thousand years are like a day.”\n\nWe are, in fact, living in the last days. Each day draws us closer to the second arrival of our King.\n\nIf we want to know whether or not we are living in the “end of times,” let’s become aware of the signs and warnings provided for us in Scripture. We can specifically take note of the condition that the world will be in at the time of His return, described in 2 Timothy 3:1-5",
      "scripture": ["2 Timothy 3:1-5", " 2 Peter 3:8", "Matthew 24:36"],
      "subtitle": "On the last days people shall be lovers of themselves",
      "timestamp": {"__time__": "2022-10-16T16:02:51.718Z"},
      "title": "End of days"
